import React, {useState } from 'react'
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';


const Contact = props => {
    const[name, setName] = useState('')
    const[email, setEmail] = useState('')
    const[message, setMessage] = useState('')

    const handleSubmit = (e) => {
        e.preventDefault()
        const contactInfo = {
            name:name,
            email:email,
            message:message
        }
    }


    return (
        <div className='contact-page'>
            <h2>E-mail me at <a href = "mailto: abc@example.com">meredithbashert@gmail.com</a></h2>

            <h1>OR</h1>
                <form className='contact-form' onSubmit='handleSubmit'>
                    <input type="text" id='name'  value={name} onChange={e => setName(e.target.value)}/><br/>
                    <input type="text" id='email' value={email} onChange={e => setEmail(e.target.value)}/><br/>
                    <input type="textarea" rows='4' id='message' value={message} onChange={e => setMessage(e.target.value)}/><br/>
                    <input type='submit' value='Send Message'/>
                </form>
        </div>
    )
}


export default Contact
